 ('artcl_11','2016-03-25 05:03:32','Super','xstore,jartcl_tag_java_basic,artcl_tag_spring_session','admin','Discount Configuration ','Discount configuration requires a few key parameters: Discount type code, application method code, calculation method code, associating discounts to groups, and associating discounts to transaction types. Once the discounts are set up, the sale associate can apply these pre-defined discounts during sale transactions. ',NULL,'C:/poscode_REPO/artcl_11.txt','2016-03-25 05:03:32',7,'Article','artcl_cat_java'),
 ('artcl_12','2016-03-25 05:06:22','Super','artcl_tag_java_basic','admin','Java IO',' Java IO is an API that comes with Java which is targeted at reading and writing data (input and output). Most applications need to process some input and produce some output based on that input. For instance, read data from a file or over network, and write to a file or write a response back over the network.The Java IO API is located in the Java IO package (java.io). If you look at the Java IO classes in the java.io package the vast amount of choices can be rather confusing. What is the purpose of all these classes? Which one should you choose for a given task? How do you create your own classes to plugin? etc. The purpose of this tutorial is to try to give you an overview of how all these classes are grouped, and the purpose behind them, so you don\'t have to wonder whether you chose the right class, or whether a class already exists for your purpose. ',NULL,'C:/poscode_REPO/artcl_12.txt','2016-03-25 05:06:22',10,'Article','artcl_cat_java'),
